  false,\n\t\"url\": null,\n\t\"notes\": \"The Pre_Disaster Mitigation (PDM) program
  is authorized by Section 203 of the Stafford Act, 42 U.S.C. 5133. The PDM program
  is designed to assist States, Territories, Indian Tribal governments, and local
  communities in implementing a sustained pre_disaster natural hazard mitigation program
  to reduce overall risk to the population and structures from future hazard events,
  while also reducing reliance on Federal funding from future disasters. PDM grants
  are subject to the availability of appropriations funding, as well as any directive
  or restriction made with respect to such funds.\",\n\t\"license_title\": \"License
